import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Login';
import Memo from './Memo';
// 다른 필요한 컴포넌트 임포트

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/memo" element={<Memo />} />
        {/* 다른 라우트 설정 */}
      </Routes>
    </Router>
  );
}

export default App;


